import '../App.css';
import React from "react";
import { IconName } from "react-icons/ai";
import { IconContext } from "react-icons";
import { FiLinkedin } from "react-icons/fi";
import { FiGithub } from "react-icons/fi";

import {FiTool} from "react-icons/fi"

class FooterBar extends React.Component{
    render(){
        return (
            <IconContext.Provider value={{ color: "whitesmoke", className: "footerbar", size: "1.4em" }}>
  <div>
            <a href='https://github.com/dhaliwalg'><FiGithub className="icons"/></a>
          <a href='cydia://url/https://cydia.saurik.com/api/share#?source=https://dhaliwalg.github.io/'><FiTool className="icons"/></a>
          <a href='https://www.linkedin.com/in/gurjit-dhaliwal/'><FiLinkedin className="icons"/></a>
  </div>
</IconContext.Provider>

        )
    }
}

export {FooterBar}
